import React from 'react';
import { Bar } from 'react-chartjs-2';

export default class BarGraph3 extends React.Component {
    render() {
        return (
            <div>
                <Bar
                    data={this.props.data}
                    options={{
                        title: {
                            display: true,
                            text: 'Average Rainfall per month',
                            fontSize: 20
                        },
                        legend: {
                            display: true,
                            position: 'left',
                        }
                    }}
                />
            </div>
        );
    }
}
